(1, 'Sit proident asper', 'sit-proident-asper', '<div>\r\n<div>Lorem ipsum dolor sit amet consectetur adipisicing elit. Minus amet doloremque esse quo excepturi veritatis? Praesentium consectetur assumenda vero ea totam et excepturi odio, exercitationem cumque quasi iure dolores necessitatibus inventore voluptatibus explicabo esse, ab laborum tempora magni sunt dolor eligendi itaque aperiam? Non voluptate, beatae nulla unde necessitatibus adipisci voluptates veniam at laboriosam. Repudiandae, maxime possimus! Optio libero asperiores expedita vero cupiditate maiores ipsa sint officiis pariatur nobis. Provident aut nesciunt, praesentium quos fugit vel eius repellendus sed architecto, nobis voluptas ullam magni mollitia numquam officiis. Modi, odio iure non quas similique quisquam? Aliquid aspernatur quo earum necessitatibus optio sequi iure eveniet aut praesentium eaque, vero dignissimos asperiores quam quibusdam enim! Consectetur aut voluptatum pariatur cupiditate, non perferendis atque, alias neque ratione unde facere nihil architecto recusandae cumque dignissimos adipisci repellat cum illo quod ea quas iste! Facilis, itaque. Harum ratione dolor quidem at quo, ullam praesentium doloribus cum voluptatibus rerum consectetur eius cumque animi vero reiciendis laborum amet ipsum. Non delectus iste numquam. Autem earum cupiditate impedit, vel possimus voluptas nesciunt porro voluptatem, nobis illo sed repudiandae temporibus eos quis laudantium consequuntur a incidunt veritatis deserunt explicabo. Beatae expedita quia commodi perferendis sit, odio tempore rem repudiandae eligendi.</div>\r\n</div>', 'thumbnails/1792853595944492.jpeg', 'Consectetur veniam', '2024-03-07 02:00:27', '2024-03-07 02:00:27'),
(2, 'Dolore sint consequ', 'dolore-sint-consequ', '<div>\r\n<div>Lorem ipsum dolor sit amet consectetur adipisicing elit. Minus amet doloremque esse quo excepturi veritatis? Praesentium consectetur assumenda vero ea totam et excepturi odio, exercitationem cumque quasi iure dolores necessitatibus inventore voluptatibus explicabo esse, ab laborum tempora magni sunt dolor eligendi itaque aperiam? Non voluptate, beatae nulla unde necessitatibus adipisci voluptates veniam at laboriosam. Repudiandae, maxime possimus! Optio libero asperiores expedita vero cupiditate maiores ipsa sint officiis pariatur nobis. Provident aut nesciunt, praesentium quos fugit vel eius repellendus sed architecto, nobis voluptas ullam magni mollitia numquam officiis. Modi, odio iure non quas similique quisquam?</div>\r\n</div>', 'thumbnails/1792854177949205.jpeg', 'Quidem est omnis eaq', '2024-03-07 02:09:42', '2024-03-07 02:09:42'),
(3, 'Computer programmingorcoding', 'computer-programming-or-coding', '<p><strong>Computer programming</strong>&nbsp;or&nbsp;<strong>coding</strong>&nbsp;is the composition of sequences of instructions, called&nbsp;<a title=\"Computer program\" href=\"https://en.wikipedia.org/wiki/Computer_program\">programs</a>, that&nbsp;<a title=\"Computer\" href=\"https://en.wikipedia.org/wiki/Computer\">computers</a>&nbsp;can follow to perform tasks.<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-1\">[1]</a></sup><sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-2\">[2]</a></sup>&nbsp;It involves designing and implementing&nbsp;<a title=\"Algorithm\" href=\"https://en.wikipedia.org/wiki/Algorithm\">algorithms</a>, step-by-step specifications of procedures, by writing&nbsp;<a title=\"Source code\" href=\"https://en.wikipedia.org/wiki/Source_code\">code</a>&nbsp;in one or more&nbsp;<a title=\"Programming language\" href=\"https://en.wikipedia.org/wiki/Programming_language\">programming languages</a>. Programmers typically use&nbsp;<a title=\"High-level programming language\" href=\"https://en.wikipedia.org/wiki/High-level_programming_language\">high-level programming languages</a>&nbsp;that are more easily intelligible to humans than&nbsp;<a title=\"Machine code\" href=\"https://en.wikipedia.org/wiki/Machine_code\">machine code</a>, which is directly executed by the&nbsp;<a title=\"Central processing unit\" href=\"https://en.wikipedia.org/wiki/Central_processing_unit\">central processing unit</a>. Proficient programming usually requires expertise in several different subjects, including knowledge of the&nbsp;<a title=\"Domain (software engineering)\" href=\"https://en.wikipedia.org/wiki/Domain_(software_engineering)\">application domain</a>, details of programming languages and generic code&nbsp;<a title=\"Library (computing)\" href=\"https://en.wikipedia.org/wiki/Library_(computing)\">libraries</a>, specialized algorithms, and formal&nbsp;<a title=\"Logic\" href=\"https://en.wikipedia.org/wiki/Logic\">logic</a>.</p>\r\n<p>Auxiliary tasks accompanying and related to programming include&nbsp;<a title=\"Requirements analysis\" href=\"https://en.wikipedia.org/wiki/Requirements_analysis\">analyzing requirements</a>,&nbsp;<a title=\"Software testing\" href=\"https://en.wikipedia.org/wiki/Software_testing\">testing</a>,&nbsp;<a title=\"Debugging\" href=\"https://en.wikipedia.org/wiki/Debugging\">debugging</a>&nbsp;(investigating and fixing problems), implementation of&nbsp;<a title=\"Build automation\" href=\"https://en.wikipedia.org/wiki/Build_automation\">build systems</a>, and management of derived&nbsp;<a title=\"Artifact (software development)\" href=\"https://en.wikipedia.org/wiki/Artifact_(software_development)\">artifacts</a>, such as programs\'&nbsp;<a title=\"Machine code\" href=\"https://en.wikipedia.org/wiki/Machine_code\">machine code</a>. While these are sometimes considered programming, often the term&nbsp;<em><a title=\"Software development\" href=\"https://en.wikipedia.org/wiki/Software_development\">software development</a></em>&nbsp;is used for this larger overall process &ndash; with the terms&nbsp;<em>programming</em>,&nbsp;<em>implementation</em>, and&nbsp;<em>coding</em>&nbsp;reserved for the writing and editing of code per se. Sometimes software development is known as&nbsp;<em><a title=\"Software engineering\" href=\"https://en.wikipedia.org/wiki/Software_engineering\">software engineering</a></em>, especially when it employs&nbsp;<a title=\"Formal methods\" href=\"https://en.wikipedia.org/wiki/Formal_methods\">formal methods</a>&nbsp;or follows an&nbsp;<a title=\"Engineering design process\" href=\"https://en.wikipedia.org/wiki/Engineering_design_process\">engineering design process</a>.</p>\r\n<h2><span id=\"History\" class=\"mw-headline\">History</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a title=\"Edit section: History\" href=\"https://en.wikipedia.org/w/index.php?title=Computer_programming&amp;action=edit&amp;section=1\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h2>\r\n<figure class=\"mw-default-size\">\r\n<figcaption><a title=\"Ada Lovelace\" href=\"https://en.wikipedia.org/wiki/Ada_Lovelace\">Ada Lovelace</a>, whose notes added to the end of&nbsp;<a class=\"mw-redirect\" title=\"Luigi Menabrea\" href=\"https://en.wikipedia.org/wiki/Luigi_Menabrea\">Luigi Menabrea</a>\'s paper included the first&nbsp;<a title=\"Algorithm\" href=\"https://en.wikipedia.org/wiki/Algorithm\">algorithm</a>&nbsp;designed for processing by&nbsp;<a title=\"Charles Babbage\" href=\"https://en.wikipedia.org/wiki/Charles_Babbage\">Charles Babbage</a>\'s&nbsp;<a class=\"mw-redirect\" title=\"Analytical Engine\" href=\"https://en.wikipedia.org/wiki/Analytical_Engine\">Analytical Engine</a>. She is often recognized as history\'s first computer programmer.</figcaption>\r\n</figure>\r\n<div class=\"hatnote navigation-not-searchable\" role=\"note\">See also:&nbsp;<a title=\"Computer program\" href=\"https://en.wikipedia.org/wiki/Computer_program#History\">Computer program &sect;&nbsp;History</a>,&nbsp;<a title=\"Programmer\" href=\"https://en.wikipedia.org/wiki/Programmer#History\">Programmer &sect;&nbsp;History</a>, and&nbsp;<a title=\"History of programming languages\" href=\"https://en.wikipedia.org/wiki/History_of_programming_languages\">History of programming languages</a></div>\r\n<p><a title=\"Program (machine)\" href=\"https://en.wikipedia.org/wiki/Program_(machine)\">Programmable devices</a>&nbsp;have existed for centuries. As early as the 9th century, a programmable&nbsp;<a title=\"Music sequencer\" href=\"https://en.wikipedia.org/wiki/Music_sequencer\">music sequencer</a>&nbsp;was invented by the Persian&nbsp;<a class=\"mw-redirect\" title=\"Banu Musa\" href=\"https://en.wikipedia.org/wiki/Banu_Musa\">Banu Musa</a>&nbsp;bro</p>\r\n<p><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:Ada_lovelace.jpg\"><img class=\"mw-file-element\" style=\"float: right;\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/0/0f/Ada_lovelace.jpg/220px-Ada_lovelace.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/0/0f/Ada_lovelace.jpg/330px-Ada_lovelace.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/0/0f/Ada_lovelace.jpg 2x\" width=\"220\" height=\"303\" data-file-width=\"418\" data-file-height=\"575\"></a></p>\r\n<p>thers, who described an automated mechanical&nbsp;<a title=\"Flute\" href=\"https://en.wikipedia.org/wiki/Flute\">flute</a>&nbsp;player in the&nbsp;<em><a title=\"Book of Ingenious Devices\" href=\"https://en.wikipedia.org/wiki/Book_of_Ingenious_Devices\">Book of Ingenious Devices</a></em>.<sup id=\"cite_ref-Koetsier_3-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-Koetsier-3\">[3]</a></sup><sup id=\"cite_ref-4\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-4\">[4]</a></sup>&nbsp;In 1206, the Arab engineer&nbsp;<a class=\"mw-redirect\" title=\"Al-Jazari\" href=\"https://en.wikipedia.org/wiki/Al-Jazari\">Al-Jazari</a>&nbsp;invented a programmable&nbsp;<a title=\"Drum machine\" href=\"https://en.wikipedia.org/wiki/Drum_machine\">drum machine</a>&nbsp;where a musical mechanical&nbsp;<a title=\"Automaton\" href=\"https://en.wikipedia.org/wiki/Automaton\">automaton</a>&nbsp;could be made to play different rhythms and drum patterns, via pegs and&nbsp;<a title=\"Cam (mechanism)\" href=\"https://en.wikipedia.org/wiki/Cam_(mechanism)\">cams</a>.<sup id=\"cite_ref-5\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-5\">[5]</a></sup><sup id=\"cite_ref-Sharkey_6-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-Sharkey-6\">[6]</a></sup>&nbsp;In 1801, the&nbsp;<a class=\"mw-redirect\" title=\"Jacquard loom\" href=\"https://en.wikipedia.org/wiki/Jacquard_loom\">Jacquard loom</a>&nbsp;could produce entirely different weaves by changing the \"program\" &ndash; a series of&nbsp;<a title=\"Card stock\" href=\"https://en.wikipedia.org/wiki/Card_stock\">pasteboard</a>&nbsp;cards with holes punched in them.</p>\r\n<p><a class=\"mw-redirect\" title=\"Code-breaking\" href=\"https://en.wikipedia.org/wiki/Code-breaking\">Code-breaking</a>&nbsp;algorithms have also existed for centuries. In the 9th century, the&nbsp;<a class=\"mw-redirect\" title=\"Mathematics in medieval Islam\" href=\"https://en.wikipedia.org/wiki/Mathematics_in_medieval_Islam\">Arab mathematician</a>&nbsp;<a title=\"Al-Kindi\" href=\"https://en.wikipedia.org/wiki/Al-Kindi\">Al-Kindi</a>&nbsp;described a&nbsp;<a class=\"mw-redirect\" title=\"Cryptographic\" href=\"https://en.wikipedia.org/wiki/Cryptographic\">cryptographic</a>&nbsp;algorithm for deciphering encrypted code, in&nbsp;<em>A Manuscript on Deciphering Cryptographic Messages</em>. He gave the first description of&nbsp;<a title=\"Cryptanalysis\" href=\"https://en.wikipedia.org/wiki/Cryptanalysis\">cryptanalysis</a>&nbsp;by&nbsp;<a title=\"Frequency analysis\" href=\"https://en.wikipedia.org/wiki/Frequency_analysis\">frequency analysis</a>, the earliest code-breaking algorithm.<sup id=\"cite_ref-7\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-7\">[7]</a></sup></p>\r\n<p>The first&nbsp;<a title=\"Computer program\" href=\"https://en.wikipedia.org/wiki/Computer_program\">computer program</a>&nbsp;is generally dated to 1843, when mathematician&nbsp;<a title=\"Ada Lovelace\" href=\"https://en.wikipedia.org/wiki/Ada_Lovelace\">Ada Lovelace</a>&nbsp;published an&nbsp;<a title=\"Algorithm\" href=\"https://en.wikipedia.org/wiki/Algorithm\">algorithm</a>&nbsp;to calculate a sequence of&nbsp;<a class=\"mw-redirect\" title=\"Bernoulli numbers\" href=\"https://en.wikipedia.org/wiki/Bernoulli_numbers\">Bernoulli numbers</a>, intended to be carried out by&nbsp;<a title=\"Charles Babbage\" href=\"https://en.wikipedia.org/wiki/Charles_Babbage\">Charles Babbage</a>\'s&nbsp;<a class=\"mw-redirect\" title=\"Analytical Engine\" href=\"https://en.wikipedia.org/wiki/Analytical_Engine\">Analytical Engine</a>.<sup id=\"cite_ref-IEEE_8-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-IEEE-8\">[8]</a></sup></p>\r\n<figure class=\"mw-default-size\">\r\n<figcaption>Data and instructions were once stored on external <a title=\"Punched card\" href=\"https://en.wikipedia.org/wiki/Punched_card\">punched cards</a>, which were kept in order and arranged in program decks.</figcaption>\r\n</figure>\r\n<p>In the 1880s,&nbsp;<a title=\"Herman Hollerith\" href=\"https://en.wikipedia.org/wiki/Herman_Hollerith\">Herman Hollerith</a>&nbsp;invented the concept of storing&nbsp;<em>data</em>&nbsp;in m</p>\r\n<p><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:PunchCardDecks.agr.jpg\"><img class=\"mw-file-element\" style=\"float: right;\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/8/86/PunchCardDecks.agr.jpg/220px-PunchCardDecks.agr.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/8/86/PunchCardDecks.agr.jpg/330px-PunchCardDecks.agr.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/8/86/PunchCardDecks.agr.jpg/440px-PunchCardDecks.agr.jpg 2x\" width=\"220\" height=\"244\" data-file-width=\"1401\" data-file-height=\"1554\"></a></p>\r\n<p>achine-readable form.<sup id=\"cite_ref-9\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-9\">[9]</a></sup>&nbsp;Later a&nbsp;<a title=\"Plugboard\" href=\"https://en.wikipedia.org/wiki/Plugboard\">control panel</a>&nbsp;(plug board) added to his 1906 Type I Tabulator allowed it to be programmed for different jobs, and by the late 1940s,&nbsp;<a title=\"Unit record equipment\" href=\"https://en.wikipedia.org/wiki/Unit_record_equipment\">unit record equipment</a>&nbsp;such as the&nbsp;<a title=\"IBM 602\" href=\"https://en.wikipedia.org/wiki/IBM_602\">IBM 602</a>&nbsp;and&nbsp;<a title=\"IBM 604\" href=\"https://en.wikipedia.org/wiki/IBM_604\">IBM 604</a>, were programmed by control panels in a similar way, as were the first&nbsp;<a class=\"mw-redirect\" title=\"Electronic computer\" href=\"https://en.wikipedia.org/wiki/Electronic_computer\">electronic computers</a>. However, with the concept of the&nbsp;<a title=\"Stored-program computer\" href=\"https://en.wikipedia.org/wiki/Stored-program_computer\">stored-program computer</a>&nbsp;introduced in 1949, both programs and data were stored and manipulated in the same way in&nbsp;<a title=\"Computer memory\" href=\"https://en.wikipedia.org/wiki/Computer_memory\">computer memory</a>.<sup id=\"cite_ref-10\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-10\">[10]</a></sup></p>\r\n<h3><span id=\"Machine_language\" class=\"mw-headline\">Machine language</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a title=\"Edit section: Machine language\" href=\"https://en.wikipedia.org/w/index.php?title=Computer_programming&amp;action=edit&amp;section=2\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h3>\r\n<p><a title=\"Machine code\" href=\"https://en.wikipedia.org/wiki/Machine_code\">Machine code</a>&nbsp;was the language of early programs, written in the&nbsp;<a title=\"Instruction set architecture\" href=\"https://en.wikipedia.org/wiki/Instruction_set_architecture\">instruction set</a>&nbsp;of the particular machine, often in&nbsp;<a class=\"mw-redirect\" title=\"Binary numeral system\" href=\"https://en.wikipedia.org/wiki/Binary_numeral_system\">binary</a>&nbsp;notation.&nbsp;<a title=\"Assembly language\" href=\"https://en.wikipedia.org/wiki/Assembly_language\">Assembly languages</a>&nbsp;were soon developed that let the programmer specify instruction in a text format (e.g., ADD X, TOTAL), with abbreviations for each operation code and meaningful names for specifying addresses. However, because an assembly language is little more than a different notation for a machine language, two machines with&nbsp;<a title=\"Comparison of instruction set architectures\" href=\"https://en.wikipedia.org/wiki/Comparison_of_instruction_set_architectures\">different instruction sets</a>&nbsp;also have different assembly languages.</p>\r\n<figure class=\"mw-default-size\">\r\n<figcaption>Wired <a title=\"Plugboard\" href=\"https://en.wikipedia.org/wiki/Plugboard\">control panel</a>&nbsp;for an&nbsp;<a class=\"mw-redirect\" title=\"IBM 402 Accounting Machine\" href=\"https://en.wikipedia.org/wiki/IBM_402_Accounting_Machine\">IBM 402 Accounting Machine</a>. Wires connect pulse streams from the card reader to counters and other internal logic and ultimately to the printer.</figcaption>\r\n</figure>\r\n<h3><span id=\"Compiler_languages\" class=\"mw-headline\">Compiler languages</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a title=\"Edit section: Compiler languages\" href=\"https://en.wikipedia.org/w/index.php?title=Computer_programming&amp;action=edit&amp;section=3\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h3>\r\n<div class=\"hatnote navigation-not-searchable\" role=\"note\">See also:&nbsp;<a title=\"Compiler\" href=\"https://en.wikipedia.org/wiki/Compiler\">Compiler</a></div>\r\n<p><a class=\"mw-redirect\" title=\"High-level language\" href=\"https://en.wikipedia.org/wiki/High-level_language\">High-level languages</a>&nbsp;made the process of developing a program simpler&nbsp;</p>\r\n<p><a class=\"mw-file-description\" href=\"https://en.wikipedia.org/wiki/File:IBM402plugboard.Shrigley.wireside.jpg\"><img class=\"mw-file-element\" style=\"float: right;\" src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b7/IBM402plugboard.Shrigley.wireside.jpg/220px-IBM402plugboard.Shrigley.wireside.jpg\" srcset=\"//upload.wikimedia.org/wikipedia/commons/thumb/b/b7/IBM402plugboard.Shrigley.wireside.jpg/330px-IBM402plugboard.Shrigley.wireside.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/b/b7/IBM402plugboard.Shrigley.wireside.jpg/440px-IBM402plugboard.Shrigley.wireside.jpg 2x\" width=\"220\" height=\"165\" data-file-width=\"1024\" data-file-height=\"768\"></a></p>\r\n<p>and more understandable, and less bound to the underlying&nbsp;<a title=\"Computer hardware\" href=\"https://en.wikipedia.org/wiki/Computer_hardware\">hardware</a>. The first compiler related tool, the&nbsp;<a title=\"A-0 System\" href=\"https://en.wikipedia.org/wiki/A-0_System\">A-0 System</a>, was developed in 1952<sup id=\"cite_ref-11\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-11\">[11]</a></sup>&nbsp;by&nbsp;<a title=\"Grace Hopper\" href=\"https://en.wikipedia.org/wiki/Grace_Hopper\">Grace Hopper</a>, who also coined the term \'compiler\'.<sup id=\"cite_ref-wikles1968_12-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-wikles1968-12\">[12]</a></sup><sup id=\"cite_ref-computerhistory.org_13-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-computerhistory.org-13\">[13]</a></sup>&nbsp;<a class=\"mw-redirect\" title=\"FORTRAN\" href=\"https://en.wikipedia.org/wiki/FORTRAN\">FORTRAN</a>, the first widely used high-level language to have a functional implementation, came out in 1957,<sup id=\"cite_ref-bergstein_14-0\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-bergstein-14\">[14]</a></sup>&nbsp;and many other languages were soon developed&mdash;in particular,&nbsp;<a title=\"COBOL\" href=\"https://en.wikipedia.org/wiki/COBOL\">COBOL</a>&nbsp;aimed at commercial data processing, and&nbsp;<a title=\"Lisp (programming language)\" href=\"https://en.wikipedia.org/wiki/Lisp_(programming_language)\">Lisp</a>&nbsp;for computer research.</p>\r\n<p>These compiled languages allow the programmer to write programs in terms that are syntactically richer, and more capable of&nbsp;<a title=\"Abstraction (computer science)\" href=\"https://en.wikipedia.org/wiki/Abstraction_(computer_science)\">abstracting</a>&nbsp;the code, making it easy to target varying machine instruction sets via compilation declarations and&nbsp;<a title=\"Heuristic (computer science)\" href=\"https://en.wikipedia.org/wiki/Heuristic_(computer_science)\">heuristics</a>. Compilers harnessed the power of computers to make programming easier<sup id=\"cite_ref-bergstein_14-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Computer_programming#cite_note-bergstein-14\">[14]</a></sup>&nbsp;by allowing programmers to specify calculations by entering a formula using&nbsp;<a title=\"Infix notation\" href=\"https://en.wikipedia.org/wiki/Infix_notation\">infix notation</a>.</p>\r\n<h3><span id=\"Source_code_entry\" class=\"mw-headline\">Source code entry</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a title=\"Edit section: Source code entry\" href=\"https://en.wikipedia.org/w/index.php?title=Computer_programming&amp;action=edit&amp;section=4\">edit</a><span class=\"mw-editsection-bracket\">]</span></span></h3>\r\n<div class=\"hatnote navigation-not-searchable\" role=\"note\">See also:&nbsp;<a title=\"Computer programming in the punched card era\" href=\"https://en.wikipedia.org/wiki/Computer_programming_in_the_punched_card_era\">Computer programming in the punched card era</a></div>\r\n<p>Programs were mostly entered using punched cards or&nbsp;<a class=\"mw-redirect\" title=\"Paper tape\" href=\"https://en.wikipedia.org/wiki/Paper_tape\">paper tape</a>. By the late 1960s,&nbsp;<a class=\"mw-redirect\" title=\"Data storage device\" href=\"https://en.wikipedia.org/wiki/Data_storage_device\">data storage devices</a>&nbsp;and&nbsp;<a title=\"Computer terminal\" href=\"https://en.wikipedia.org/wiki/Computer_terminal\">computer terminals</a>&nbsp;became inexpensive enough that programs could be created by typing directly into the computers.&nbsp;<a title=\"Text editor\" href=\"https://en.wikipedia.org/wiki/Text_editor\">Text editors</a>&nbsp;were also developed that allowed changes and corrections to be made much more easily than with&nbsp;<a title=\"Punched card sorter\" href=\"https://en.wikipedia.org/wiki/Punched_card_sorter\">punched cards</a>.</p>', 'thumbnails/1793114843946973.jpeg', 'Cupidatat deserunt q', '2024-03-09 23:12:53', '2024-03-09 23:14:26');

